svg.script:
var imageFrames = 100;
var imageWidth = 30000;
var circleDelay = 60;
var circleDirection=true;

var frameWidth = imageWidth/imageFrames;
var startXPos=false;
var startImageXPos=false;
var lastEventXPos=false;
var circleInterval = false;
var image = false;
var isPaused=false;
var circleFunction = function(){
	var x = parseInt(image.getAttribute("x"));
	if (circleDirection) {
		if (x<=(-imageWidth+frameWidth)) x=0;
		else x-=frameWidth;
	} else {
		if (x==0) x=-imageWidth+frameWidth;
		else x+=frameWidth;
	}
	image.setAttribute("x",x);
};
window.addEventListener('load',function(){
	image = this.document.getElementById("mainImage");

	var left1 = this.document.getElementById("left1");
	var left2 = this.document.getElementById("left2");
	var right1 = this.document.getElementById("right1");
	var right2 = this.document.getElementById("right2");
	var but1 = this.document.getElementById("but1");
	var but2 = this.document.getElementById("but2");

	circleInterval = window.setInterval(circleFunction,circleDelay);
	function onMove(pos) {
		if (!startXPos) return;

		lastEventXPos = pos;
		var frameOptimizedWidth = frameWidth*1.4;
		var xOffset = pos-startXPos;

		if (Math.abs(xOffset)>=(frameOptimizedWidth/imageFrames)) {
			var framesOffset = Math.floor(Math.abs(xOffset/(frameOptimizedWidth/imageFrames)));
			var _imageXPos = startImageXPos;
			if (xOffset<=0) _imageXPos-=framesOffset*frameWidth;
			else _imageXPos+=framesOffset*frameWidth;
			if (_imageXPos>0) _imageXPos-=imageWidth;
			if (_imageXPos<=-imageWidth) _imageXPos+=imageWidth;
			image.setAttribute("x",_imageXPos);
		}
	}
	but2.addEventListener("click",function(event){
		isPaused=false;

		left2.setAttribute("style","visibility:hidden");
		but2.setAttribute("style","visibility:hidden");
		right2.setAttribute("style","visibility:hidden");
		left1.setAttribute("style","");
		but1.setAttribute("style","");
		right1.setAttribute("style","");

		if (circleInterval) return;
		circleInterval = window.setInterval(circleFunction,circleDelay);
	});
	but1.addEventListener("click",function(event){
		isPaused=true;

		left1.setAttribute("style","visibility:hidden");
		but1.setAttribute("style","visibility:hidden");
		right1.setAttribute("style","visibility:hidden");
		left2.setAttribute("style","");
		but2.setAttribute("style","");
		right2.setAttribute("style","");

		if (!circleInterval) return;
		clearInterval(circleInterval);
		circleInterval=false;
	});
	left1.addEventListener("click",function(event){
		circleDirection=true;
	});
	right1.addEventListener("click",function(event){
		circleDirection=false;
	});
	left2.addEventListener("click",function(event){
		var x = parseInt(image.getAttribute("x"));
		if (x<=(-imageWidth+frameWidth)) x=0;
		else x-=frameWidth;
		image.setAttribute("x",x);
		circleDirection=true;
	});
	right2.addEventListener("click",function(event){
		var x = parseInt(image.getAttribute("x"));
		if (x==0) x=-imageWidth+frameWidth;
		else x+=frameWidth;
		image.setAttribute("x",x);
		circleDirection=false;
	});
	image.addEventListener("mousemove",function(event) {
		onMove(event.clientX);
	});
	image.addEventListener("touchmove",function(event) {
		event.preventDefault();
		var touch = event.targetTouches[0];
		onMove(touch.clientX);
	});
	function onStart(pos) {
		startXPos = pos;
		startImageXPos = parseInt(image.getAttribute("x"));
		lastEventXPos = pos;

		if (!circleInterval) return;
		clearInterval(circleInterval);
		circleInterval=false;
	}
	image.addEventListener("mousedown",function(event){
		onStart(event.clientX)
	});
	image.addEventListener("touchstart",function(event) {
		var touch = event.targetTouches[0];
		onStart(touch.clientX)
	});
	function onEnd() {
		if (startXPos && lastEventXPos) circleDirection = (startXPos-lastEventXPos)>=0;
		startXPos=false;
		startImageXPos=false;
		lastEventXPos=false;

		if (isPaused) return;
		if (circleInterval) return;
		circleInterval = window.setInterval(circleFunction,circleDelay);
	}
	image.addEventListener("touchend",onEnd);
	image.addEventListener("mouseup",onEnd);
	image.addEventListener("mouseout",onEnd);
},false);
